export function WinningCard() {
        return (
            <td >
                <div className="card">
                    Move to the next board!
                </div>
            </td>
        )

}

export function JackPotCard() {
    return (
        <td >
            <div className="card">
                You Win!
            </div>
        </td>
    )
}

export function GuessCard(ind, func) {
    return (
        <td>
            <div className="card" id={ind} onClick={(e) => func(e)}>
                
            </div>
        </td>
    )
}

export function BlankCard() {
    return (
        <td>
            <div className="card">
                
            </div>
        </td>
    )
}
